export default function ResultGraph(props){
  const resultArray = props.result
  return(
    <div>
      <a className="title">Result</a>
      <br/>
      <a className="final-answer">Final answer: {resultArray[0][0]}</a>
      <br/>
      <a className="title">Confidence breakdown:</a>
      <br/>

      {resultArray.map((result, index) => (
        <div className="confidence-element">
          <div className="bar"/>
          <p>{result[0]}</p>
          <p>{result[1]}%</p>
        </div>
      ))}
      <style jsx>{`
        .title{}

        .bar{
          height: 10vh;
          width: 50px;
          background-color: #555;
        }
        `}</style>
    </div>
  )
}
